import { BrowserRoter as Router } from "react-router-dom";
import Layout from './components/layout/Layout';

import Routing  from "./routing";

function App() {
  return (
    <Router>
      <Layout>
        <Routing/>
      </Layout>
    </Router>
  );
}

export default App;
